import React from 'react';
import ReturndAsh from './Dash';
import GridLoader from 'react-spinners/GridLoader';
import '../Loading.css';
import { auth } from '../firebase';
import SignUp from '../Sign/Main';

// Dash board view 
export default function DAsh() {

 const [loading, setLoading] = React.useState(false);
 const [people, setPleople] = React.useState();

 const user = auth.currentUser;

 React.useEffect(() => {

  setLoading(true);
  setTimeout(() => {
   setLoading(false);
   setPleople(user);
  }, 3600);

 }, []);

 return (
  <div>
   {
    loading ?
     <div className='App-loading'>
      <GridLoader
       size={15}
       color={'#00b8d4'}
       loading={loading}
      />
     </div>
     :
     <>
      {people ? <ReturndAsh /> : <SignUp />}
     </>
   }
  </div>
 );
};
